import React from "react";
import SocialMediaButton from "./buttons/SocialMediaButton";

function Footer() {
  return (
    <footer>
      <div className="socialContainer">
        <SocialMediaButton redes="redes facebook" social="fab fa-facebook-f" />
        <SocialMediaButton social="fab fa-twitter" />
        <SocialMediaButton social="fab fa-instagram" />
        <SocialMediaButton social="fab fa-youtube" />
      </div>
    </footer>
  );
}

export default Footer;
